import React from 'react';

const withSpinner=function(wrappedComponent)
{
    
 const dangerous=({isloading})=>
 {
     if(isloading===true)
     {
         <h1>Spinner</h1>
     }
     else
     {
         <h1>No SPinner</h1>
     }
 }

   return dangerous
}
export default withSpinner
